	const [AddedColor, setAddedColor] = useState<AddedColors[]>([])

	const handleSubmit = ( event) => {
		event.pre
	}

	return (
		<form onSubmit={handleSubmit}>
			<label>
				Enter color name:
				<br />
				<input type='text' />
				<br />
				Enter Hex value:
				<br />
				<input type='text' name='' id='hexValue' />
				<br />
			</label>
			<input type='submit' />
		</form>
	)
}
